import PostList from "../components/posts/PostList";

const HomePage = () => {
  const handleClick = (e) => {
    navigate("/posts/new");
  };
  return (
    <div className="homePage">
      <button onClick={handleClick}>Creer un post</button>
      <h1>Home Page</h1>
      <PostList />
    </div>
  );
};

export default HomePage;
